import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  content: {
    flex: 1,
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center'
  },
  container: {
    flex: 1,
    alignItems: 'flex-start',
    paddingHorizontal: 20,
  },
  profile: {
    marginTop: 30,
    width: 100,
    flexDirection: 'row',
    alignItems: 'center',
    height: 100
  }
});

export default styles;
